use AvaNyadeEmployee
GO


CREATE TABLE BelongTo (
       BelongID             INTEGER NOT NULL,
       EmployeeID           INTEGER,
       DepartmentID         INTEGER,
       StartDate            DATETIME,
       EndDate              DATETIME
);


ALTER TABLE BelongTo
       ADD PRIMARY KEY (BelongID);


CREATE TABLE Categories (
       CategoryID           INTEGER NOT NULL,
       CategoryName         VARCHAR(100)
);


ALTER TABLE Categories
       ADD PRIMARY KEY (CategoryID);


CREATE TABLE CustomerClasses (
       CustomerClassID      INTEGER NOT NULL,
       CustomerClassName    VARCHAR(100)
);


ALTER TABLE CustomerClasses
       ADD PRIMARY KEY (CustomerClassID);


CREATE TABLE Customers (
       CustomerID           INTEGER NOT NULL,
       CustomerCode         INTEGER,
       CustomerName         VARCHAR(100),
       Address              VARCHAR(100),
       CustomerClassID      INTEGER,
       PrefecturalID        INTEGER
);


ALTER TABLE Customers
       ADD PRIMARY KEY (CustomerID);


CREATE TABLE Departments (
       DepartmentID         INTEGER NOT NULL,
       DepartmentName       VARCHAR(100)
);


ALTER TABLE Departments
       ADD PRIMARY KEY (DepartmentID);


CREATE TABLE Employees (
       EmployeeID           INTEGER NOT NULL,
       EmployeeName         VARCHAR(100),
       Height               INTEGER,
       Email                VARCHAR(100),
       Weight               INTEGER,
       HireFiscalYear       INTEGER,
       Birthday             DATETIME, 
       BloodType            VARCHAR(2),
       PassWords           VARCHAR(10)
);


ALTER TABLE Employees
       ADD PRIMARY KEY (EmployeeID);


CREATE TABLE Prefecturals (
       PrefecturalID        INTEGER NOT NULL,
       PrefecturalName      VARCHAR(100)
);


ALTER TABLE Prefecturals
       ADD PRIMARY KEY (PrefecturalID);


CREATE TABLE Products (
       ProductID            INTEGER NOT NULL,
       ProductCode          INTEGER,
       ProductName          VARCHAR(100),
       Price                INTEGER,
       CategoryID           INTEGER
);


ALTER TABLE Products
       ADD PRIMARY KEY (ProductID);


CREATE TABLE Salary (
       SalaryID             INTEGER NOT NULL,
       PayDate              DATETIME,
       Amount               INTEGER,
       EmployeeID           INTEGER
);


ALTER TABLE Salary
       ADD PRIMARY KEY (SalaryID);


CREATE TABLE Sales (
       SaleID               INTEGER NOT NULL,
       Quantity             INTEGER,
       CustomerID           INTEGER,
       ProductID            INTEGER,
       EmployeeID           INTEGER,
       SaleDate             DATETIME
);


ALTER TABLE Sales
       ADD PRIMARY KEY (SaleID);


